import React, { useState } from 'react';
import ReactDOM from 'react-dom';
import Slider from 'react-input-slider';

import './App.css';

class alcSlider extends React.Component{
  constructor(props){
    super(props);
    this.state ={
      x: 5,
      y:5,
    }
  } 
  render(){
    return(
       <div>
          ({state.x}, {state.y})
         <Slider axis="xy" x={state.x} y={state.y} onChange={setState} />
         <Slider
         axis="x"
         x={state.x}
         onChange={({ x }) => setState(state => ({...state, x }))}
         />
         <Slider 
         axis ="y" 
         y={state.y} 
         onChange={({ y })=> setState(state=>({...state, y}))}
        />
        </div>
    );
  }
}

function App() {
  const CraftSlider = new alcSlider();
    return (
    <div className="App">
      <header>

        <form>
        <li key="barName">
        <label>
          <h2>What is the Barname: </h2><br/>
          <input type = "text" id="barName"/>
        </label>
        </li>
        <li key="craft">
          <CraftSlider />        
        </li>
        <li key="wineList">

        </li>
        </form>
       </header>
    </div>
  );
}





export default App;
